//1 CANTIDAD DE USUARIOS POR DIA

val users_per_day = sessions.withColumn("Y-M-D", to_date($"session_init")).groupBy($"Y-M-D").agg(countDistinct('user_id).as("cantidad")).orderBy($"Y-M-D") //Agrupo por dia y cuento los usuarios distintos
users_per_day.show

//4 MEDIANA DE RENDERS, PLAYS Y CHECKOUTS 

def calculate_median(column_target: String) : Unit = {

    val sessions_amount = sessions.count().toInt //Cantidad de filas del dataset

    val window = Window.orderBy(column_target) //Ventana para ordenar la columna de menor a mayor
    val sessions_enumerated = sessions.withColumn("row_number", row_number() over window) //Enumeramos las filas

    if (sessions_amount % 2 == 0) {

        val l = sessions_amount / 2 //Calculamos los numeros de filas correspondientes para calcular la mediana
        val r = l + 1
        val median = sessions_enumerated.where($"row_number" === l or $"row_number" === r) //Seleccionamos las dos filas del medio
                                        .agg(avg(column_target).as(column_target.replace("amount", "median"))) //Sacamos el promedio 
        median.show

    } else {

        val l = sessions_amount / 2 + 1 //Calculamos el numero de fila correspondiente para calcular la mediana
        val median = sessions_enumerated.where($"row_number" === l).select(column_target) //Seleccionamos la fila correspondiente
                                        .withColumnRenamed(column_target, column_target.replace("amount", "median")) //Renombramos la columna
        median.show

    }
}

calculate_median("renders_amount")
calculate_median("plays_amount")
calculate_median("checkout_amount")

//6 CHECKOUT PROMEDIO POR SESION

val checkout_avg = sessions.withColumn("checkout_average", $"amount"/$"checkout_amount").select($"user_id", $"checkout_average").orderBy(desc("checkout_average")) //Promedio de checkouts por usuario
z.show(checkout_avg)
